        [SetUp]
        public void Setup()
        {
            // init solution 
            solution = new Solution1();
            // log level 
            solution.EnableDebug = true;
            Trace.Listeners.Add(new ConsoleTraceListener());
        }

        [Test]
        [TestCaseSource(nameof(testCases))]
        public void Test1(string testCaseName, int[] nums, int[][] queries, int[] expected)
        {
            int[] actual;
            long duration;
            Profile(solution.SumEvenAfterQueries, nums, queries, out actual, out duration);

            Assert.AreEqual(expected, actual);
            Assert.Less(duration, _maxDuration, $"{testCaseName} took long; {duration} ms");
        }

        // Solution 
        private ISolution solution;
        private delegate int[] SolDelegate(int[] nums, int[][] queries);
        private static int _maxDuration = 10;
        private void Profile(SolDelegate solutionMethod, int[] nums, int[][] queries, out int[] actual, out long duration)
        {
            // stopwatch
            var sw = new System.Diagnostics.Stopwatch();
            // run
            sw.Start();
            // execute
            actual = solutionMethod(nums, queries);

            // stop
            sw.Stop();
            // get duration
            duration = sw.ElapsedMilliseconds;
        }

